	/// <summary>
	/// This gets the cycle notation of the given turn
	/// </summary>
	/// <param name="stickerIndex">
	/// Sticker index to turn around
	/// (center stickers indicate hyperface recenter)
	/// </param>
	/// <param name="turnType">Degree type of turn</param>
	/// <returns>Array of cycles of hypersticker indexes</returns>
	public static int[,] GetCycles(int stickerIndex, HypercubeTurner.TurnType turnType)
	{

		// Relative piece analogous to the center cube
		int relativeBasePiece = stickerIndex % 27;

		// Indexes of thee middle, edge, and corner hyperstickers
		List<int> middlePieceIndecies = new List<int>() { 5, 11, 13, 15, 17, 23 };
		List<int> edgePieceIndecies = new List<int>() { 2, 4, 6, 8, 10, 12, 16, 18, 20, 22, 24, 26 };
		List<int> cornerPieceIndecies = new List<int>() { 1, 3, 7, 9, 19, 21, 25, 0 };

		// Correct cycle index is calculated by getting the relative hypersticker
		// (0-26), then getting the correct hypersticker of that type (given by
		// the order of the indexes in the lists above), then adding 27 * x such
		// that the correct color hyperface sticker turn is returned

		// If center hypersticker
		if (relativeBasePiece == 14)
		{
			return centerChangeTurns[stickerIndex / 27];
		}

		// If clockwise middle hypersticker
		else if (
			turnType == HypercubeTurner.TurnType.Clockwise &&
			middlePieceIndecies.Contains(relativeBasePiece))
		{
			return faceTurns90[6 * (stickerIndex / 27) + middlePieceIndecies.IndexOf(relativeBasePiece)];
		}

		// If half turn middle hypersticker
		else if (turnType == HypercubeTurner.TurnType.HalfTurn &&
			middlePieceIndecies.Contains(relativeBasePiece))
		{
			return faceTurns180[6 * (stickerIndex / 27) + middlePieceIndecies.IndexOf(relativeBasePiece)];
		}

		// If counter-clockwise middle hypersticker
		else if (turnType == HypercubeTurner.TurnType.CounterClockwise &&
			middlePieceIndecies.Contains(relativeBasePiece))
		{
			return faceTurns270[6 * (stickerIndex / 27) + middlePieceIndecies.IndexOf(relativeBasePiece)];
		}

		// If edge hypersticker
		else if (edgePieceIndecies.Contains(relativeBasePiece))
		{
			return edgeTurns[12 * (stickerIndex / 27) + edgePieceIndecies.IndexOf(relativeBasePiece)];
		}

		// If clockwise corner hypersticker
		else if (
			turnType == HypercubeTurner.TurnType.Clockwise &&
			cornerPieceIndecies.Contains(relativeBasePiece))
		{
			return cornerTurns120[8 * ((stickerIndex - 1) / 27) + cornerPieceIndecies.IndexOf(relativeBasePiece)];
		}

		// If counter-clockwise corner hypersticker
		else if (
			turnType == HypercubeTurner.TurnType.CounterClockwise &&
			cornerPieceIndecies.Contains(relativeBasePiece))
		{
			return cornerTurns240[8 * ((stickerIndex - 1) / 27) + cornerPieceIndecies.IndexOf(relativeBasePiece)];
		}

		// Return identity in incorrect input
		return new int[,] { { } };
	}

